(1, 1, '2024-10-30 08:48:06', '2024-10-30 08:48:06', '<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2024-10-30 08:48:06', '2024-10-30 08:48:06', '', 0, 'http://localhost/wordpress/wordpress/?p=1', 0, 'post', '', 1),
(2, 1, '2024-10-30 08:48:06', '2024-10-30 08:48:06', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/wordpress/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2024-10-30 08:48:06', '2024-10-30 08:48:06', '', 0, 'http://localhost/wordpress/wordpress/?page_id=2', 0, 'page', '', 0),
(3, 1, '2024-10-30 08:48:06', '2024-10-30 08:48:06', '<!-- wp:heading {\"style\":{\"color\":{\"text\":\"#b3b3b4\"},\"elements\":{\"link\":{\"color\":{\"text\":\"#b3b3b4\"}}}}} -->\n<h2 class=\"wp-block-heading has-text-color has-link-color\" style=\"color:#b3b3b4\">Thank you for using Falafel w Bas. The Terms and Conditions and Privacy policy are intended to make you aware of your legal rights and responsibilities with respect to your access to and use of the Falafel w Bas.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Your privacy is very important to us. It is Falafel w Bas policy to respect your privacy regarding any information we may collect while operating our The Site. We created our Privacy Policy and Site Usage Rules to make important disclosures about how you can use Falafel w Bas to list your business for the public to see/use and how we collect and can use your content and information. We encourage you to read this Policy to help you make informed decisions.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please understand that your use of The Site and its listing services automatically enters you in agreement with our Terms, Conditions and Privacy Policy. We use your data to make our business and delivery better, to serve you better. Your data will be used to improve site dynamic and make what we do better and more efficient. We use your data and knowledge of how people view your listing to create new site capabilities and enhancements.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We use your data to make our business and delivery better. Your data will be used to improve site dynamics and capability of its searches. Falafel w Bas collects non-personally-identifying information that web browsers and servers typically make available, such as the browser type, language preference, referring site, and the date and time of each web visit. Our purpose in collecting non-personally identifying information is to better understand how our web visitors and customers use its website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We use the Order Information that we collect generally to fulfill any orders placed through the Site (including processing your payment information, arranging for shipping, and providing you with invoices and/or order confirmations).</p>\n<!-- /wp:paragraph -->', 'Privacy Policy', '', 'publish', 'closed', 'open', '', 'privacy-policy', '', '', '2024-11-02 13:42:23', '2024-11-02 13:42:23', '', 0, 'http://localhost/wordpress/wordpress/?page_id=3', 0, 'page', '', 0),
