(126, 1, '2024-11-01 10:38:42', '2024-11-01 10:38:42', '<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Thank you for using Falafel w Bas. The Terms and Conditions and Privacy policy are intended to make you aware of your legal rights and responsibilities with respect to your access to and use of the Falafel w Bas.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Your privacy is very important to us. It is Falafel w Bas policy to respect your privacy regarding any information we may collect while operating our The Site. We created our Privacy Policy and Site Usage Rules to make important disclosures about how you can use Falafel w Bas to list your business for the public to see/use and how we collect and can use your content and information. We encourage you to read this Policy to help you make informed decisions.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please understand that your use of The Site and its listing services automatically enters you in agreement with our Terms, Conditions and Privacy Policy. We use your data to make our business and delivery better, to serve you better. Your data will be used to improve site dynamic and make what we do better and more efficient. We use your data and knowledge of how people view your listing to create new site capabilities and enhancements.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We use your data to make our business and delivery better. Your data will be used to improve site dynamics and capability of its searches. Falafel w Bas collects non-personally-identifying information that web browsers and servers typically make available, such as the browser type, language preference, referring site, and the date and time of each web visit. Our purpose in collecting non-personally identifying information is to better understand how our web visitors and customers use its website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We use the Order Information that we collect generally to fulfill any orders placed through the Site (including processing your payment information, arranging for shipping, and providing you with invoices and/or order confirmations).</p>\n<!-- /wp:paragraph -->', 'Privacy Policy', '', 'inherit', 'closed', 'closed', '', '3-revision-v1', '', '', '2024-11-01 10:38:42', '2024-11-01 10:38:42', '', 3, 'http://localhost/wordpress/wordpress/?p=126', 0, 'revision', '', 0),
(127, 1, '2024-11-01 10:40:30', '2024-11-01 10:40:30', '<!-- wp:paragraph -->\n<p>We are happy to assist you and manage all your requests,</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Refunds Due to the perishable nature of our product, we do not accept returns. In the event you are dissatisfied with your purchase, you must contact us within a day of receiving your order. We reserve the right to limit refunds and replacements, and we can only offer one replacement per consumer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cancellation or change of order Any change in order including cancellations must be communicated to us before 1 hour the same business day. If outside of this timeline, we cannot guarantee the change or cancellation.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please contact us. We are very happy to serve you.be applied to your credit card or original method of payment, within a certain amount of days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Then contact your credit card company, it may take some time before your refund is officially posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Next contact your bank. There is often some processing time before a refund is posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you’ve done all of this and you still have not received your refund yet, please contact us at {email address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h3 class=\"wp-block-heading\">Sale items</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Only regular priced items may be refunded. Sale items cannot be refunded.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><h2>Exchanges</h2></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We only replace items if they are defective or damaged. If you need to exchange it for the same item, send us an email at {email address} and send your item to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><h2>Gifts</h2></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item was marked as a gift when purchased and shipped directly to you, you’ll receive a gift credit for the value of your return. Once the returned item is received, a gift certificate will be mailed to you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item wasn’t marked as a gift when purchased, or the gift giver had the order shipped to themselves to give to you later, we will send a refund to the gift giver and they will find out about your return.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><h2>Shipping returns</h2></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To return your product, you should mail your product to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Depending on where you live, the time it may take for your exchanged product to reach you may vary.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are returning more expensive items, you may consider using a trackable shipping service or purchasing shipping insurance. We don’t guarantee that we will receive your returned item.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><h2>Need help?</h2></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contact us at {email} for questions related to refunds and returns.</p>\n<!-- /wp:paragraph -->', 'Refund and Returns Policy', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2024-11-01 10:40:30', '2024-11-01 10:40:30', '', 11, 'http://localhost/wordpress/wordpress/?p=127', 0, 'revision', '', 0),
