INSERT INTO `wp_trp_gettext_ar` (`id`, `original`, `translated`, `domain`, `status`, `original_id`, `plural_form`) VALUES
(1, 'Mini-Cart', '', 'woocommerce', 0, 1, 0),
(2, 'The Mini-Cart template allows shoppers to see their cart items and provides access to the Cart and Checkout pages.', '', 'woocommerce', 0, 2, 0),
(3, 'words', '', 'woocommerce', 0, 3, 0),
(4, 'Proceed to PayPal', '', 'woocommerce', 0, 4, 0),
(5, 'PayPal Standard', '', 'woocommerce', 0, 5, 0),
(6, 'PayPal Standard redirects customers to PayPal to enter their payment information.', '', 'woocommerce', 0, 6, 0),
(7, 'Enable/Disable', '', 'woocommerce', 0, 7, 0),
(8, 'Enable PayPal Standard', '', 'woocommerce', 0, 8, 0),
(9, 'Title', '', 'woocommerce', 0, 9, 0),
(10, 'This controls the title which the user sees during checkout.', '', 'woocommerce', 0, 10, 0),
(11, 'PayPal', '', 'woocommerce', 0, 11, 0),
(12, 'Description', '', 'woocommerce', 0, 12, 0),
(13, 'This controls the description which the user sees during checkout.', '', 'woocommerce', 0, 13, 0),
(14, 'Pay via PayPal; you can pay with your credit card if you don\'t have a PayPal account.', '', 'woocommerce', 0, 14, 0),
(15, 'PayPal email', '', 'woocommerce', 0, 15, 0),
(16, 'Please enter your PayPal email address; this is needed in order to take payment.', '', 'woocommerce', 0, 16, 0),
(17, 'Advanced options', '', 'woocommerce', 0, 17, 0),
(18, 'PayPal sandbox', '', 'woocommerce', 0, 18, 0),
(19, 'Enable PayPal sandbox', '', 'woocommerce', 0, 19, 0),
(20, 'PayPal sandbox can be used to test payments. Sign up for a <a href=\"%s\">developer account</a>.', '', 'woocommerce', 0, 20, 0),
(21, 'Debug log', '', 'woocommerce', 0, 21, 0),
(22, 'Enable logging', '', 'woocommerce', 0, 22, 0),
(23, 'Log PayPal events such as IPN requests and review them on the <a href=\"%s\">Logs screen</a>. Note: this may log personal information. We recommend using this for debugging purposes only and deleting the logs when finished.', '', 'woocommerce', 0, 23, 0),
(24, 'IPN email notifications', '', 'woocommerce', 0, 24, 0),
(25, 'Enable IPN email notifications', '', 'woocommerce', 0, 25, 0),
(26, 'Send notifications when an IPN is received from PayPal indicating refunds, chargebacks and cancellations.', '', 'woocommerce', 0, 26, 0),
(27, 'Receiver email', '', 'woocommerce', 0, 27, 0),
(28, 'If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.', '', 'woocommerce', 0, 28, 0),
(29, 'PayPal identity token', '', 'woocommerce', 0, 29, 0),
(30, 'Optionally enable \"Payment Data Transfer\" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.', '', 'woocommerce', 0, 30, 0),
(31, 'Invoice prefix', '', 'woocommerce', 0, 31, 0),
(32, 'Please enter a prefix for your invoice numbers. If you use your PayPal account for multiple stores ensure this prefix is unique as PayPal will not allow orders with the same invoice number.', '', 'woocommerce', 0, 32, 0),
(33, 'Shipping details', '', 'woocommerce', 0, 33, 0),
(34, 'Send shipping details to PayPal instead of billing.', '', 'woocommerce', 0, 34, 0),
(35, 'PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.', '', 'woocommerce', 0, 35, 0),
(36, 'Address override', '', 'woocommerce', 0, 36, 0),
(37, 'Enable \"address_override\" to prevent address information from being changed.', '', 'woocommerce', 0, 37, 0),
(38, 'PayPal verifies addresses therefore this setting can cause errors (we recommend keeping it disabled).', '', 'woocommerce', 0, 38, 0),
(39, 'Payment action', '', 'woocommerce', 0, 39, 0),
(40, 'Choose whether you wish to capture funds immediately or authorize payment only.', '', 'woocommerce', 0, 40, 0),
(41, 'Capture', '', 'woocommerce', 0, 41, 0),
(42, 'Authorize', '', 'woocommerce', 0, 42, 0),
(43, 'Image url', '', 'woocommerce', 0, 43, 0),
(44, 'Optionally enter the URL to a 150x50px image displayed as your logo in the upper left corner of the PayPal checkout pages.', '', 'woocommerce', 0, 44, 0),
(45, 'Optional', '', 'woocommerce', 0, 45, 0),
(46, 'API credentials', '', 'woocommerce', 0, 46, 0),
(47, 'Enter your PayPal API credentials to process refunds via PayPal. Learn how to access your <a href=\"%s\">PayPal API Credentials</a>.', '', 'woocommerce', 0, 47, 0),
(48, 'Live API username', '', 'woocommerce', 0, 48, 0),
(49, 'Get your API credentials from PayPal.', '', 'woocommerce', 0, 49, 0),
(50, 'Live API password', '', 'woocommerce', 0, 50, 0),
(51, 'Live API signature', '', 'woocommerce', 0, 51, 0),
(52, 'Sandbox API username', '', 'woocommerce', 0, 52, 0),
(53, 'Sandbox API password', '', 'woocommerce', 0, 53, 0),
(54, 'Sandbox API signature', '', 'woocommerce', 0, 54, 0),
(55, 'Direct bank transfer', '', 'woocommerce', 0, 55, 0),
(56, 'Take payments in person via BACS. More commonly known as direct bank/wire transfer.', '', 'woocommerce', 0, 56, 0),
(57, 'Enable bank transfer', '', 'woocommerce', 0, 57, 0),
(58, 'Payment method description that the customer will see on your checkout.', '', 'woocommerce', 0, 58, 0),
(59, 'Make your payment directly into our bank account. Please use your Order ID as the payment reference. Your order will not be shipped until the funds have cleared in our account.', '', 'woocommerce', 0, 59, 0),
(60, 'Instructions', '', 'woocommerce', 0, 60, 0),
(61, 'Instructions that will be added to the thank you page and emails.', '', 'woocommerce', 0, 61, 0),
(62, 'Check payments', '', 'woocommerce', 0, 62, 0),
(63, 'Take payments in person via checks. This offline gateway can also be useful to test purchases.', '', 'woocommerce', 0, 63, 0),
(64, 'Enable check payments', '', 'woocommerce', 0, 64, 0),
