(180, 'Affirm’s tailored Buy Now Pay Later programs remove price as a barrier, turning browsers into buyers, increasing average order value, and expanding your customer base.', '', 'woocommerce', 0, 180, 0),
(181, 'Afterpay', '', 'woocommerce', 0, 181, 0),
(182, 'Afterpay allows customers to receive products immediately and pay for purchases over four installments, always interest-free.', '', 'woocommerce', 0, 182, 0),
(183, 'Airwallex Payments', '', 'woocommerce', 0, 183, 0),
(184, 'Boost international sales and save on FX fees. Accept 60+ local payment methods including Apple Pay and Google Pay.', '', 'woocommerce', 0, 184, 0),
(185, 'Amazon Pay', '', 'woocommerce', 0, 185, 0),
(186, 'Enable a familiar, fast checkout for hundreds of millions of active Amazon customers globally.', '', 'woocommerce', 0, 186, 0),
