(188, 'Take payments in cash upon delivery.', '', 'woocommerce', 0, 188, 0),
(189, 'Eway', '', 'woocommerce', 0, 189, 0),
(190, 'The Eway extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.', '', 'woocommerce', 0, 190, 0),
(191, 'Klarna Checkout', '', 'woocommerce', 0, 191, 0),
(192, 'Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries.', '', 'woocommerce', 0, 192, 0),
(193, 'Klarna Payments', '', 'woocommerce', 0, 193, 0),
(194, 'Mollie', '', 'woocommerce', 0, 194, 0),
(195, 'Effortless payments by Mollie: Offer global and local payment methods, get onboarded in minutes, and supported in your language.', '', 'woocommerce', 0, 195, 0),
(196, 'Payfast', '', 'woocommerce', 0, 196, 0),
(197, 'The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.', '', 'woocommerce', 0, 197, 0),
(198, 'Payoneer Checkout', '', 'woocommerce', 0, 198, 0),
(199, 'Payoneer Checkout is the next generation of payment processing platforms, giving merchants around the world the solutions and direction they need to succeed in today’s hyper-competitive global market.', '', 'woocommerce', 0, 199, 0),
(200, 'Paystack', '', 'woocommerce', 0, 200, 0),
(201, 'Paystack helps African merchants accept one-time and recurring payments online with a modern, safe, and secure payment gateway.', '', 'woocommerce', 0, 201, 0),
(202, 'PayU for WooCommerce', '', 'woocommerce', 0, 202, 0),
(203, 'Enable PayU’s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!', '', 'woocommerce', 0, 203, 0),
(204, 'PayPal Payments', '', 'woocommerce', 0, 204, 0),
(205, 'Safe and secure payments using credit cards or your customer\'s PayPal account.', '', 'woocommerce', 0, 205, 0),
(206, 'Razorpay', '', 'woocommerce', 0, 206, 0),
(207, 'The official Razorpay extension for WooCommerce allows you to accept credit cards, debit cards, netbanking, wallet, and UPI payments.', '', 'woocommerce', 0, 207, 0),
(208, 'Square', '', 'woocommerce', 0, 208, 0),
(209, 'Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place.', '', 'woocommerce', 0, 209, 0),
(210, ' Stripe', '', 'woocommerce', 0, 210, 0),
(211, 'Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay.', '', 'woocommerce', 0, 211, 0),
(212, 'Mercado Pago', '', 'woocommerce', 0, 212, 0),
(213, 'Set up your payment methods and accept credit and debit cards, cash, bank transfers and money from your Mercado Pago account. Offer safe and secure payments with Latin America’s leading processor.', '', 'woocommerce', 0, 213, 0),
(214, 'WooPayments', '', 'woocommerce', 0, 214, 0),
(215, 'Manage transactions without leaving your WordPress Dashboard. Only with WooPayments.', '', 'woocommerce', 0, 215, 0),
(216, 'With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies. Track cash flow and manage recurring revenue directly from your store’s dashboard - with no setup costs or monthly fees.', '', 'woocommerce', 0, 216, 0),
(217, 'With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies – with no setup costs or monthly fees – and you can now accept in-person payments with the Woo mobile app.', '', 'woocommerce', 0, 217, 0),
(218, 'Activate BNPL instantly on WooPayments', '', 'woocommerce', 0, 218, 0),
(219, 'The world’s favorite buy now, pay later options and many more are right at your fingertips with WooPayments — all from one dashboard, without needing multiple extensions and logins.', '', 'woocommerce', 0, 219, 0),
(220, 'Zip Co - Buy Now, Pay Later', '', 'woocommerce', 0, 220, 0),
