(196, 'Payfast', 'woocommerce', 'trp_context', ''),
(197, 'The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.', 'woocommerce', 'trp_context', ''),
(198, 'Payoneer Checkout', 'woocommerce', 'trp_context', ''),
